import React from "react";
import { useState } from "react";
const Counter = () => {
  const [number, setNumber] = useState(0);

  return (
    <div>
      Your score is: {number}{" "}
      <span
        onClick={() => {
          setNumber(number++);
        }}
      >
        +
      </span>
      <span
        onClick={() => {
          number > 0 ? setNumber(number--) : 0;
        }}
      >
        -
      </span>
    </div>
  );
};

export default Counter;
